  let guessedAnswers = []

  function decodeSeed(){
    const input = seedBox.querySelectorAll("input")[0]
    const seed = input.value
    const seedToAnswers = seed.split("/")
    if(seedToAnswers.length!=4) return false
    let seedToValues = []
    seedToAnswers.forEach(answer=>{
      seedToValues.push((((Number(answer)+3)/2)+4)/7)
    })
    if(seedToValues.length!=4) return false
    for(let j = 0; j<seedToValues.length; j++){
      if(seedToValues[j]%1!=0) return false
      answers.push(allWords[seedToValues[j]].split(""))
    }
    answers.forEach(answer=>{
      guessedAnswers.push(false)
    })
    answers[0] = ["L","I","Z","E","L"]
    return true
  }

